// React component: Place Your Picks Here tab (full version only)
import React, { useState } from 'react';

const PlaceYourPicks = () => {
  const [password, setPassword] = useState('');
  const [gameName, setGameName] = useState('');
  const [error, setError] = useState('');
  const [message, setMessage] = useState('');
  const [picks, setPicks] = useState([]);

  const gameList = [
    { date: 'Aug 31', time: '7:00 PM', team1: 'Roughriders (+3.5)', team2: 'Stampeders (-3.5)' },
    { date: 'Sep 1', time: '1:00 PM', team1: 'Bears (+1.5)', team2: 'Packers (-1.5)' },
  ];

  const handlePick = (team) => {
    if (picks.includes(team)) {
      setPicks(picks.filter((t) => t !== team));
    } else {
      if (picks.length >= 10) {
        setError('You must pick exactly 10 teams.');
      } else {
        setPicks([...picks, team]);
        setError('');
      }
    }
  };

  const handleSubmit = () => {
    if (picks.length !== 10) {
      setError('You must pick exactly 10 teams before submitting.');
      return;
    }
    setMessage('Picks submitted successfully.');
    setError('');
  };

  return (
    <div className="p-4 border rounded shadow bg-white">
      <h2 className="text-xl font-bold text-red-600 mb-2">
        üîí For Security purposes, you must enter your username and Password to gain access to the game.
      </h2>

      <div className="mb-4">
        <label className="block mb-1">üî¢ 4-digit Password:</label>
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="border p-2 w-full"
        />
      </div>

      <div className="mb-4">
        <label className="block mb-1">üßë Game Name:</label>
        <input
          type="text"
          value={gameName}
          onChange={(e) => setGameName(e.target.value)}
          className="border p-2 w-full"
        />
      </div>

      {gameName && gameName.toLowerCase() !== 'masterblaster' && (
        <p className="text-red-500">‚ùå Incorrect game name, please try again.</p>
      )}

      <div className="my-4">
        <p>üß† You can only pick 10 teams, which include the CFL and the NFL.</p>
        <p>üö® If you enter too many or too few picks, you will receive an error message.</p>
        <p>‚è∞ The deadline for entering your picks is Thursday at 1:00 PM CST.</p>
        <p>üéØ Press the button for the team you desire; press again to unpick.</p>
        <p>üîí Once you press Submit Picks, you will be unable to make changes. Double-check first!</p>
      </div>

      <table className="w-full table-auto border">
        <thead>
          <tr>
            <th className="border px-2">Date</th>
            <th className="border px-2">Time</th>
            <th className="border px-2">Team 1</th>
            <th className="border px-2">Team 2</th>
            <th className="border px-2">Pick</th>
          </tr>
        </thead>
        <tbody>
          {gameList.map((game, index) => (
            <tr key={index}>
              <td className="border px-2">{game.date}</td>
              <td className="border px-2">{game.time}</td>
              <td className="border px-2">{game.team1}</td>
              <td className="border px-2">{game.team2}</td>
              <td className="border px-2 space-x-2">
                <button
                  onClick={() => handlePick(game.team1)}
                  className={`px-2 py-1 border ${picks.includes(game.team1) ? 'bg-green-200' : 'bg-white'}`}
                >
                  Team 1
                </button>
                <button
                  onClick={() => handlePick(game.team2)}
                  className={`px-2 py-1 border ${picks.includes(game.team2) ? 'bg-green-200' : 'bg-white'}`}
                >
                  Team 2
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="mt-4">
        ‚úÖ Selected: {picks.length} teams
        <br />
        <button onClick={handleSubmit} className="bg-blue-600 text-white px-4 py-2 mt-2 rounded">
          Submit Picks
        </button>
        {error && <p className="text-red-600 mt-2">üõë {error}</p>}
        {message && <p className="text-green-600 mt-2">‚úÖ {message}</p>}
      </div>
    </div>
  );
};

export default PlaceYourPicks;
